// src/components/OrderConfirmationPage.js

import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './OrderConfirmationPage.css';

function OrderConfirmationPage() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    gender: '',
    age: '',
    email: '',
    password: '',
    address: '',
    addressLine2: '', // New field added
    pincode: '', // New field added
    country: 'Afghanistan',
    phone: '',
  });

  const navigate = useNavigate();

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Save form data to local storage
    localStorage.setItem('userDetails', JSON.stringify(formData));
    console.log('Form submitted with details:', formData);

    // Clear form data after submission
    setFormData({
      firstName: '',
      lastName: '',
      gender: '',
      age: '',
      email: '',
      password: '',
      address: '',
      addressLine2: '', // Clear new field
      pincode: '', // Clear new field
      country: 'Afghanistan',
      phone: '',
    });

    // Navigate to the invoice page after submission
    navigate('/invoicepage');
  };

  return (
    <div className="order-confirmation-page">
      <h2 className="user-summary-title">USER DETAILS</h2>
      <form onSubmit={handleSubmit} className="order-form">
        <div className="form-row">
          <div className="form-group">
            <label>First Name *</label>
            <input 
              type="text" 
              name="firstName" 
              value={formData.firstName} 
              onChange={handleInputChange} 
              required 
            />
          </div>
          <div className="form-group">
            <label>Last Name *</label>
            <input 
              type="text" 
              name="lastName" 
              value={formData.lastName} 
              onChange={handleInputChange} 
              required 
            />
          </div>
        </div>
        <div className="form-row">
          <div className="form-group">
            <label>Gender *</label>
            <input 
              type="text" 
              name="gender" 
              value={formData.gender} 
              onChange={handleInputChange} 
              required 
            />
          </div>
          <div className="form-group">
            <label>Age *</label>
            <input 
              type="number" 
              name="age" 
              value={formData.age} 
              onChange={handleInputChange} 
              required 
            />
          </div>
        </div>
        <div className="form-row">
          <div className="form-group">
            <label>User Email *</label>
            <input 
              type="email" 
              name="email" 
              value={formData.email} 
              onChange={handleInputChange} 
              required 
            />
          </div>
          <div className="form-group">
            <label>User Password *</label>
            <input 
              type="password" 
              name="password" 
              value={formData.password} 
              onChange={handleInputChange} 
              required 
            />
          </div>
        </div>
        <h3>Billing Address</h3>
        <div className="form-row">
          <div className="form-group">
            <label>Address Line 1 *</label>
            <input 
              type="text" 
              name="address" 
              value={formData.address} 
              onChange={handleInputChange} 
              required 
            />
          </div>
          <div className="form-group">
            <label>Address Line 2</label>
            <input 
              type="text" 
              name="addressLine2" 
              value={formData.addressLine2} 
              onChange={handleInputChange} 
            />
          </div>
        </div>
        <div className="form-row">
          <div className="form-group">
            <label>Pincode *</label>
            <input 
              type="text" 
              name="pincode" 
              value={formData.pincode} 
              onChange={handleInputChange} 
              required 
            />
          </div>
          <div className="form-group">
            <label>Country *</label>
            <select 
              name="country" 
              value={formData.country} 
              onChange={handleInputChange} 
              required
            >
              <option value="India">India</option>
              <option value="Afghanistan">Afghanistan</option>
              <option value="USA">USA</option>
              {/* Add more country options here */}
            </select>
          </div>
        </div>
        <div className="form-row">
          <div className="form-group">
            <label>Phone *</label>
            <input 
              type="tel" 
              name="phone" 
              value={formData.phone} 
              onChange={handleInputChange} 
              required 
            />
          </div>
        </div>
        <button type="submit" className="submit-order-button">Submit</button>
      </form>
    </div>
  );
}

export default OrderConfirmationPage;
